(193, 'mts_simple_booking_reserve', 'a:7:{s:6:\"column\";a:10:{s:7:\"company\";s:1:\"0\";s:4:\"name\";s:1:\"1\";s:8:\"furigana\";s:1:\"2\";s:8:\"birthday\";s:1:\"0\";s:6:\"gender\";s:1:\"0\";s:5:\"email\";s:1:\"1\";s:8:\"postcode\";s:1:\"0\";s:7:\"address\";s:1:\"0\";s:3:\"tel\";s:1:\"1\";s:6:\"newuse\";s:1:\"0\";}s:12:\"column_order\";s:71:\"company,name,furigana,birthday,gender,email,postcode,address,tel,newuse\";s:5:\"title\";s:67:\"【山梨FUJIフルーツパーク】ご予約完了のお知らせ\";s:6:\"header\";s:1018:\"━━━━━━━━━━━━━━━━━━━━━━━━━━━━━\r\n                      【%NAME%】ご予約完了のお知らせ\r\n                           Notice of reservation completion\r\n━━━━━━━━━━━━━━━━━━━━━━━━━━━━━\r\n\r\n%CLIENT_NAME% 様\r\nご予約ID：%RESERVE_ID%\r\n\r\n当%NAME%へのご予約いただき誠にありがとうございます。\r\n\r\n以下の内容でご予約を承りました。内容に不明な点などあった場合、\r\nこちらからお問合わせさせていただく場合がございますのでご了承\r\n下さい。\r\nなお、ご来園当日まで、このメールは大切に保管お願いいたします。\r\n\r\nThank you for booking at Yamanashi Fuji Fruit Park.\r\nWe accepted your reservation with the following contents. \r\nWhen there are unclear points in contents,Please acknowledge that \r\nwe may contact you from here Please.\r\nPlease keep the confirmation mail carefully until the day.\r\n\r\n\r\n\r\n\";s:6:\"footer\";s:858:\"・・・・・・・○●     キャンセルについて     ●○・・・・・・・\r\n\r\nキャンセル手数料は特に頂いておりませんが、必ずお電話または\r\n下記URLよりキャンセルの受付をお願いいたします。受付なしの\r\nキャンセルはご遠慮くださいますようお願いいたします。\r\n\r\nCancellation fee is not particularly paid, but please be sure to call or\r\nPlease accept cancellation from the following URL. No reception\r\nPlease refrain from canceling it. Thank you.\r\n\r\n▼電話（TEL）：%TEL%\r\n▼キャンセルURL：http://booking-test.orepa.jp/booking-fujipa/index.php/subscription/\r\n\r\nこのメールにお心当たりが無い場合、以下へご連絡下さるよう\r\nお願い申し上げます。\r\n\r\n%NAME%\r\n%POSTCODE%\r\n%ADDRESS%\r\nTEL: %TEL%\r\nE-Mail: %EMAIL%\r\nWebサイト: %WEB%\r\n\";s:12:\"cancel_title\";s:64:\"【山梨FUJIフルーツパーク】ご予約のキャンセル\";s:11:\"cancel_body\";s:332:\"%CLIENT_NAME% 様\r\n\r\n当%NAME%をご利用いただき誠にありがとうございます。\r\n\r\n以下のURLをブラウザで開くと予約キャンセルが実行されます。\r\n\r\n%CANCEL_URL%\r\n\r\nまたの機会をお待ちしております。\r\n\r\n%NAME%\r\n%POSTCODE%\r\n%ADDRESS%\r\nTEL: %TEL%\r\nE-Mail: %EMAIL%\r\nWebサイト: %WEB%\";}', 'yes'),
(194, 'mts_simple_booking_contact', 'a:4:{s:6:\"column\";a:7:{s:7:\"company\";i:2;s:4:\"name\";i:1;s:8:\"furigana\";i:0;s:5:\"email\";i:1;s:8:\"postcode\";i:0;s:7:\"address\";i:0;s:3:\"tel\";i:0;}s:5:\"title\";s:39:\"【お問合わせ送信のご案内】\";s:6:\"header\";s:370:\"%CLIENT_NAME% 様\n\nお問合わせありがとうございます。以下の内容で承りました。\n後ほど担当者よりご連絡いたしますのでしばらくお待ち下さい。\n\nなお回線事情等によりメールが届かない事もありますので、\nおかしいと感じられましたら、お手数ですが改めてお知らせ下さい。\n\n\";s:6:\"footer\";s:166:\"このメールにお心当たりが無い場合、以下へご連絡下さるよう\nお願い申し上げます。\n\n%NAME%\n%TEL%\nE-Mail: %EMAIL%\nWebサイト: %WEB%\n\";}', 'yes'),
