(196, 'mts_simple_booking_charge', 'a:10:{s:9:\"accedence\";s:1:\"0\";s:9:\"terms_url\";s:0:\"\";s:11:\"charge_list\";s:1:\"1\";s:13:\"currency_code\";s:3:\"JPY\";s:12:\"tax_notation\";s:1:\"0\";s:15:\"consumption_tax\";s:1:\"0\";s:9:\"pay_first\";s:1:\"0\";s:8:\"checkout\";s:1:\"0\";s:14:\"unsettled_mail\";s:438:\"・・・・・・・○●     お支払いについて     ●○・・・・・・・\r\n\r\nこの度はご予約いただき誠にありがとうございます。お支払いについ\r\nてご案内いたします。お支払いは当日、当施設にて現金でのお支払い\r\nとなります。\r\n\r\nThank you very much for your reservation this time. About payment\r\nI will show you. Payment by cash on the day,this park It will be.\r\n\";s:12:\"settled_mail\";s:459:\"※お支払いについて※\r\n\r\nこの度はご入金いただき誠にありがとうございました。お取り引きID\r\nは次の通りです。\r\n\r\nお取り引きID：%TRANSACTION_ID%\r\n\r\nキャンセルの受付は10日前までとなります。それ以降3日前まで料金\r\nの50%、それを過ぎると全額を違約金としてお支払いいただきます。\r\nご不明な点がありましたらお気軽にお問合わせ下さい。\r\n\r\n\";}', 'yes'),
